import { createGlobalStyle } from 'styled-components';

export const GlobalStyles = createGlobalStyle`
* {
  margin: 0;
  padding: 0;
  
}
html{
  background-color: #FFFFFF;
} 
body{
    font-family: 'Poppins', sans-serif;
    font-size: 16px;
  
}



`;
